import React from 'react';
import logo from './logo.svg';
import './App.css';

// alert('Let start')

function App() {
  return (
    <div>
      <h1>APP COMPONENT</h1>
      <DropList />
      <Rating />
      <Rating />
    </div>
  );
}

function Rating() {
  return (
    <div>
      <Star />
      <Star />
      <Star />
      <Star />
      <Star />
    </div>
  )
}

function DropList() {
  return (
    <div>
      <h3>Title 1</h3>
      <ul>
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
      </ul>
    </div>
  )
}

function Star() {
  return (
    <div><em>STAR</em></div>
  )
}

export default App;
